/* LASTEST */
.lastest {
  background: url(./images/lastest-bg.png) no-repeat;
  background-size: cover;
  background-position: center center;
  padding: 3rem 0;

  .lastest-slider .slick-track {
    position: relative;
    height: 500px;

    img {
      width: 300px;
      position: absolute;
      top: 6rem;
      left: 50%;
      transform: translate(-50%, -50%);
      border-radius: 30px;
      z-index: 9;
    }
  }

  .l-slide-txt {
    background: #fff;
    width: 80%;
    height: 250px;
    padding: 10rem 0 2rem;
    border-radius: 50px;
    position: absolute;
    top: 55%;
    left: 50%;
    transform: translate(-50%, -50%);
    text-align: center;
  }

  .lastest-slider {
    p {
      margin-top: 3rem;
    }

    p,
    h4,
    h6 {
      margin-bottom: 1rem;
    }

    .btn-arrow {
      position: absolute;
      bottom: 3rem;
      left: 50%;
      transform: translate(-50%, -50%);
    }

    .slick-prev.slick-arrow,
    .slick-next.slick-arrow {
      position: absolute;
      width: 50px;
      height: 50px;
      border-radius: 100%;
      border: 0px;
      background: none;
      z-index: 10;
      top: 49%;
      transform: translate(0, -50%);
      font-size: 0rem;
      color: transparent;
      cursor: pointer;
    }

    .slick-dots {
      width: 100px;
      position: absolute;
      top: 40%;
      left: 50%;
      transform: translate(-50%, -50%);
      display: flex;
      justify-content: space-between;
    }

    #slick-slide-control10,
    #slick-slide-control11,
    #slick-slide-control12 {
      color: transparent;
      border: none;
      width: 20px;
      height: 10px;
      background: #bbb;
      border-radius: 30px;
      transition: 0.8s;
      cursor: pointer;
      z-index: 1;
    }

    #slick-slide-control10:hover,
    #slick-slide-control11:hover,
    #slick-slide-control12:hover {
      width: 30px;
    }
  }

}



