  padding: 2rem 0;
  margin: 0 auto;

  ul {
    display: flex;
    justify-content: space-between;

    li {
      color: #bbb;
      font-weight: 600;
      cursor: pointer;
      transition: 0.5s;
    }

    &:hover {
      color: #05d686;
    }
  }
}

footer> :nth-child(1)> :nth-child(2) {
  width: 100%;
  display: flex;
}

#language,
#family-site {
  width: 50%;
  border: 1px solid #ccc;
  padding: 0.5rem;
}

footer> :nth-child(2) {
  position: relative;
  padding: 1rem;

  >img {
    width: 100px;
    margin-bottom: 1rem;
  }

  > :nth-child(2) {
    font-size: 1rem;
    color: #bbb;
  }

  .sns {
    position: absolute;
    top: 0.6rem;
    right: 1rem;

    i {
      font-size: 2rem;
      color: #bbb;
      cursor: pointer;
      transition: 0.5s;

      &:hover {
        color: #05d686;
      }
    }
  }
}

